import React, { ReactElement } from 'react';

const Home = ({ userAgent }): ReactElement => (
  <h1>
    Hello world! - user agent:
    {userAgent}
  </h1>
);

Home.getInitialProps = async ({ req }) => {
  const userAgent = req ? req.headers['user-agent'] : navigator.userAgent;
  return { userAgent };
};

export default Home;
